import React from 'react';
import {imgToAscii} from '../../imgToAscii.js';

const image = () => {
    return new imgToAscii('../../testImg.jpg');
}

function ImageToAsciiContainer() {
    return(
    <div className='testImgToAscii'>
        <img src={image}></img>
    </div>
    );
}

export default ImageToAsciiContainer;
